import * as React from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';

export default function ContainedButtons() {
    const [recordState, setState] = React.useState({
        start: false,
        break: true,
        stamp: true,
        stop:  true,
        save:  true
    });
    const [date,setDate] = React.useState({
        t: new Date()
    });
    let timeArray: number[] = [];
    let flagArray: boolean[] = [];
    const [timestamp, setStamp] = React.useState({
        time : timeArray,
        flag : flagArray
    });

    var TimeStamp = timestamp.time.map((item,index) => {
        return(
            <ListItem key={index}>
                <ListItemText primary={item} />
            </ListItem>
        )
    });

    return (
        <Box>
            <Stack direction="row" spacing={2}>
                <Button 
                    variant="contained"
                    onClick={()=>{
                        let copyList = [...timestamp.time];
                        if(copyList.length === 0){
                            copyList.push(0);
                        }else{
                            let tl = timestamp.time.length;
                            let nt = new Date();
                            let ott = date.t.getTime();
                            let ntt = nt.getTime();
                            copyList.push((timestamp.time[tl-1] + (ntt-ott)/1000));
                        }
                        setState({
                            ...recordState,
                            start: true,
                            break: false,
                            stamp: false,
                            stop:  false,
                            save:  true
                        });
                        setStamp({
                            ...timestamp,
                            time : copyList
                        })
                    }}
                    disabled={recordState.start}
                >
                    スタート
                </Button>
                <Button
                    variant="contained"

                    onClick={()=>{
                        let copyList = [...timestamp.time];
                        let tl = timestamp.time.length;
                        let nt = new Date();
                        let ott = date.t.getTime();
                        let ntt = nt.getTime();
                        copyList.push((timestamp.time[tl-1] + (ntt-ott)/1000));
                        setState({
                            ...recordState,
                            start: false,
                            break: true,
                            stamp: true,
                            stop:  true,
                            save:  true
                        });
                        setDate({
                            ...date,
                            t: new Date()
                        })
                        setStamp({
                            ...timestamp,
                            time : copyList
                        })
                        setDate({
                            ...date,
                            t : new Date()
                        })
                    }}
                    disabled={recordState.break}
                >
                    一時中断
                </Button>
                <Button
                    variant="contained"
                    onClick={()=>{
                        let copyList = [...timestamp.time];
                        let tl = timestamp.time.length;
                        let nt = new Date();
                        let ott = date.t.getTime();
                        let ntt = nt.getTime();
                        copyList.push((timestamp.time[tl-1] + (ntt-ott)/1000));
                        setState({
                            ...recordState,
                            start: true,
                            break: false,
                            stamp: false,
                            stop:  false,
                            save:  true
                        });
                        setStamp({
                            ...timestamp,
                            time : copyList
                        })
                        setDate({
                            ...date,
                            t : new Date()
                        })
                    }}
                    disabled={recordState.stamp}
                >
                    タイムスタンプ
                </Button>
                <Button 
                    variant="contained"
                    onClick={()=>{
                        setState({
                            ...recordState,
                            start: true,
                            break: true,
                            stamp: true,
                            stop:  true,
                            save:  false
                        });
                    }}
                    disabled={recordState.stop}
                >
                    停止
                </Button>
                <Button
                    variant="contained"
                    onClick={()=>{
                        setState({
                            ...recordState,
                            start: false,
                            break: true,
                            stamp: true,
                            stop:  true,
                            save:  true
                        });
                    }}
                    disabled={recordState.save}
                >
                    保存
                </Button>
                <Button 
                    variant="contained"
                    onClick={()=>{
                        let copyList : any = [];
                        setState({
                            ...recordState,
                            start: false,
                            break: true,
                            stamp: true,
                            stop:  true,
                            save:  true
                        });
                        setStamp({
                            ...timestamp,
                            time : copyList
                        })
                    }}
                >
                    リセット※記録は破棄されます
                </Button>
            </Stack>
            <Box sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}>
                <nav aria-label="main mailbox folders">
                    <List>
                        {TimeStamp}
                    </List>
                </nav>
            </Box>
        </Box>
    );
}
